import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import axios from 'axios';
import KeyContext from './components/Utilities/keycontext.js'

function getAxiosConstants() {
  axios.get(`${process.env.REACT_APP_API_HOST_URL}/api/auth/token`)
      .then((response) => {
        console.log("response -> ", response.data)
        return response.data;
      })
      .catch((error) => {
        console.error(error.message);
      });
}
let keys = getAxiosConstants();
console.log("Fetched keys -> ", getAxiosConstants())
axios.defaults.withCredentials = true
axios.defaults.headers.common['Cookie'] = keys;
<KeyContext.Provider value={keys} />


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
